/** @format */

import React from 'react';
import { SupplierList } from '../TextInfo';
import SupBlock from '../components/SupBlock';

const Suppliers = () => {
	return (
		<div className='container_page'>
			<h1 className='title_exp'>Suppliers Supported</h1>
			<div className='container_exp'>
				<span className='exp_li supplier'>
					{SupplierList.map((item, index) => {
						return (
							<span key={index}>
								<SupBlock i={index} />
							</span>
						);
					})}
				</span>
			</div>
		</div>
	);
};

export default Suppliers;
